require.config({"config": {
        "text":{"Magento_InventoryInStorePickupFrontend/template/store-selector/selected-location.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<if args=\"!isLoading() && !selectedLocation()\">\n    <p class=\"no-selected-location\">\n        <translate args=\"'We could not preselect pickup location based on available information, please select it manually.'\"></translate>\n    </p>\n</if>\n<div class=\"selected-location-details location-details\" if=\"selectedLocation\">\n    <p class=\"location-name\">\n        <text args=\"selectedLocation().name\"></text>\n    </p>\n    <p class=\"location-address\">\n        <text args=\"selectedLocation().street\"></text><br/>\n        <text args=\"selectedLocation().city\"></text>, <span text=\"selectedLocation().region\"></span>\n        <text args=\"selectedLocation().postcode\"></text><br/>\n        <text args=\"selectedLocation().country\"></text><br/>\n        <a if=\"selectedLocation().telephone\"\n           attr=\"'href': 'tel:' + selectedLocation().telephone\"\n           text=\"selectedLocation().telephone\"\n        ></a>\n    </p>\n    <!-- ko with: {locationDescriptionUnsanitizedHtml: selectedLocation().description} -->\n    <p class=\"location-description\" html=\"locationDescriptionUnsanitizedHtml\"></p>\n    <!-- /ko -->\n</div>\n"}
}});
